import React from 'react'
import FormAddLinks from './FormAddLinks'
import {useSelector,useDispatch} from 'react-redux'
import axios from 'axios'
const api = 'https://randomuser.me/api/'
const  getinformation = async () =>
{
        await axios.get(api).then(res => {
            const ready= false
            const caca = res.data.results[0].name.first
            console.log("caca",caca)
            if(ready) return caca

        })
}
export default function Profil({userName}) {

    const dispatch = useDispatch()
    const {name, imageProfil} = useSelector(state=> ({...state.profilReducer}))
    const charger = ()=> {
        dispatch({
            type:'LOAD',
            name:getinformation()
        })
    }
    return (
        <div>
            <header>
                <h1>Profil de : {userName}</h1>
            </header>
            <p>{name}</p>
            <button onClick={charger}>Load</button>
            <img src = {imageProfil}/>
            <div>
                <button> Ajoutez un Lien </button>
                <FormAddLinks />
            </div>
        </div>
    )
}
